import { useDispatch, useSelector } from "react-redux";
import {
  fetchReposAction,
  fetchProfileAction,
} from "./redux/slices/reposSlice";
import { useEffect } from "react";
function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(fetchReposAction("tweneboah"));
    dispatch(fetchProfileAction("tweneboah"));
  }, []);
  return (
    <section class="jumbotron">
      <div class="container text-center">
        <h1 class="display-4">The New Internet</h1>
        <p class="lead text-muted">
          Decentralized, secure, private. The PiperNet is on it's way to
          revolutionize every smartphone, PC, and smart-fridge near you.
        </p>
        <a class="btn btn-primary my-2" href="#">
          Sign up for free
        </a>
        <a class="btn btn-link my-2" href="#">
          Read more
        </a>
      </div>
    </section>
  );
}

export default App;
